//------------------------
// MENU
//------------------------

.main-nav{
    display: flex;
    justify-content: space-between;
    background: rgba(255,255,255,0.175);
}


.pages{
    display: flex;
    list-style-type: none;
    padding: 0;
    margin: 0;
    text-align: center;
    li{
        margin: 0;

        a{
            display: block;
            color: white;
            text-decoration: none;
            padding: 1em;
            &:hover{
                color: $color-1;
            }
        }
        &.active{
            background: white;
            a{
                color: $color-text;
            }
        }
    }

}
// ---------------------------------------
// RESPONSIVE PART WITH TRIGGER
// ---------------------------------------
.trigger{
    position: fixed;
    top: 1em;
    right: 1em;
    color: white;
    text-decoration: none;
    font-family: $font-2;
    font-weight: 900;
    padding: 0.5em;
    z-index: 2;
    &.on{
        background: $color-2;
        color: $color-text;
        box-shadow: 0.5em 0.5em 0.5em $color-text;
    }
    @media screen and (min-width: 992px) {
        display: none;
      }
}
.closer{
    text-align: right;
    padding: 1em;
    @media screen and (min-width: 992px) {
       display: none;
    }
}

.main-nav{
        @media screen and (max-width:992px) {
            position: absolute;
            width: 50%;
            height: 100%;
            top: 0;
            right: -50%;
            flex-direction: column;
            justify-content: left;
            background-color: white;
            z-index: 5;
            transition: 300ms ease-in-out;
            ul li{
                &.active{
                    background: $color-2;
                }
                a{
                    color: $color-text;
                    &:hover{
                        color: $color-1;
                    }
                } 
            }

            ul:first-of-type{
                flex-direction: column;
            }
            ul:last-of-type{
                justify-content: center;
            }
        }

}

.menu-visible{
    right: 0;
}

.mask{
    position: absolute;
    top: 0;
    left: 0;
    height: 100%;
    width: 100%;
    background-color: rgba(0, 0, 0, 0.486);
    display: none;
    z-index: 4;
}

